import React from 'react';
import { createMuiTheme, formatMs, ThemeProvider } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import './App.scss';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import Header from './Header'

const theme = createMuiTheme({
    palette: {
    //type:'dark'
    },

  });

const Nav = () =>(
    <ThemeProvider theme={theme}>
    <Router> 
    <nav>
    <ul>
    <div i><li><Link to='/Header'>Home</Link></li></div>

    <li>Products</li>
    <li>Prices</li>
    <li>Contact</li>    
    </ul>
    </nav>

 <Switch>
     <Route path='/Header'><Header/></Route>
</Switch>
  </Router>
    </ThemeProvider>


    )
    export default Nav;
